	public static void gapCounter(String s)
	{
		int retVal = 0;
		for(int i = 0; i < s.length(); i++)
		{
			if(s.charAt(i) == '_')
				retVal++;
		}

		System.out.printf("Number of Gaps: %d\r\n", retVal);
	}

